function findcbarinds(
    c_bar::Vector{Vector{T}}, # [resonance group][ME group/nuclei]
    c::Vector{Vector{T}}, # [component][ME group/nuclei]
    atol = 1e-12,
    ) where T

    return collect(
        findall( xx->isapprox(xx, c_bar[k]; atol = atol), c)
        for k in eachindex(c_bar)
    )
end
inds_c_bar = findcbarinds(As[1].Δc_bar[1], As[1].Δc[1])
a_c_bar = collect( As[1].αs[1][inds_c_bar[k][begin]] for k in eachindex(inds_c_bar) )
F_c_bar = collect( As[1].Ωs[1][inds_c_bar[k][begin]] for k in eachindex(inds_c_bar) )
F_c_bar_ppm = hz2ppmfunc.( F_c_bar ./ (2*π))
@show F_c_bar_ppm
@show a_c_bar
@show inds_c_bar

function sortdescendingcols(As::Vector{Vector{T}}, a::Vector{T}) where T
    @assert length(a) == length(As)

    inds = sortperm(a, rev = true)

    #a_out = a[inds]

    B = Matrix{T}(undef, length(As[begin]), length(As))
    for c in axes(B,2)
        j = inds[c]

        B[:,c] = As[j]
    end

    return B
end

